import React from 'react';
import './App.scss';
import MenuContainer from './components/MenuContainer';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      showPopup: false,
    };
    this.handler = this.handler.bind(this);
  }

  handler() {
    this.setState({
        showPopup: true,
    });
}

  render() {
    return (
      <div className='App'>
        <MenuContainer action={this.handler}/>
      </div>
    );
  }
}
